import React from "react";
import { FaHome, FaFileAlt, FaAlignLeft } from "react-icons/fa";

const Navbar = () => {
  return (
    <div className="w-screen h-[100px] bg-grey flex justify-center">
      <div className="w-[80%] items-center flex justify-center">
        <div className="w-[10%]">
          {" "}
          <FaHome size={50} />{" "}
        </div>
        <div className="w-[10%]">
          {" "}
          <FaAlignLeft size={50} />{" "}
        </div>
        <div className="w-[10%]">
          {" "}
          <FaFileAlt size={50} />{" "}
        </div>
      </div>
    </div>
  );
};

export default Navbar;
